@property
def is_number(self):
    """Return True if the Sum has no free symbols, else False."""
    return not self.free_symbols

sympy.sympy.core.assumptions.getit:
def getit(self):
    try:
        return self._assumptions[fact]
    except KeyError:
        if self._assumptions is self.default_assumptions:
            self._assumptions = self.default_assumptions.copy()
        return _ask(fact, self)

sympy.sympy.core.cache.wrapper:
@wraps(func)
def wrapper(*args, **kwargs):
    try:
        retval = cfunc(*args, **kwargs)
    except TypeError as e:
        if not e.args or not e.args[0].startswith('unhashable type:'):
            raise
        retval = func(*args, **kwargs)
    return retval

sympy.sympy.core.decorators._func:
@wraps(func)
def _func(self, other):
    # XXX: The check for _op_priority here should be removed. It is
    # needed to stop mutable matrices from being sympified to
    # immutable matrices which breaks things in quantum...
    if not hasattr(other, '_op_priority'):
        try:
            other = sympify(other, strict=True)
        except SympifyError:
            return retval
    if not isinstance(other, expectedcls):
        return retval
    return func(self, other)

sympy.sympy.core.evalf._evalf:
def _evalf(self, prec: int) -> Expr:
    """Helper for evalf. Does the same thing but takes binary precision"""
    r = self._eval_evalf(prec)
    if r is None:
        r = self # type: ignore
    return r # type: ignore

sympy.sympy.core.expr.conjugate:
def conjugate(self):
    """Returns the complex conjugate of 'self'."""
    from sympy.functions.elementary.complexes import conjugate as c
    return c(self)

sympy.sympy.core.function._eval_evalf:
def _eval_evalf(self, prec):

    def _get_mpmath_func(fname):
        """Lookup mpmath function based on name"""
        if isinstance(self, AppliedUndef):
            # Shouldn't lookup in mpmath but might have ._imp_
            return None

        if not hasattr(mpmath, fname):
            fname = MPMATH_TRANSLATIONS.get(fname, None)
            if fname is None:
                return None
        return getattr(mpmath, fname)

    _eval_mpmath = getattr(self, '_eval_mpmath', None)
    if _eval_mpmath is None:
        func = _get_mpmath_func(self.func.__name__)
        args = self.args
    else:
        func, args = _eval_mpmath()

    # Fall-back evaluation
    if func is None:
        imp = getattr(self, '_imp_', None)
        if imp is None:
            return None
        try:
            return Float(imp(*[i.evalf(prec) for i in self.args]), prec)
        except (TypeError, ValueError):
            return None

    # Convert all args to mpf or mpc
    # Convert the arguments to *higher* precision than requested for the
    # final result.
    # XXX + 5 is a guess, it is similar to what is used in evalf.py. Should
    #     we be more intelligent about it?
    try:
        args = [arg._to_mpmath(prec + 5) for arg in args]
        def bad(m):
            from mpmath import mpf, mpc
            # the precision of an mpf value is the last element
            # if that is 1 (and m[1] is not 1 which would indicate a
            # power of 2), then the eval failed; so check that none of
            # the arguments failed to compute to a finite precision.
            # Note: An mpc value has two parts, the re and imag tuple;
            # check each of those parts, too. Anything else is allowed to
            # pass
            if isinstance(m, mpf):
                m = m._mpf_
                return m[1] !=1 and m[-1] == 1
            elif isinstance(m, mpc):
                m, n = m._mpc_
                return m[1] !=1 and m[-1] == 1 and \
                    n[1] !=1 and n[-1] == 1
            else:
                return False
        if any(bad(a) for a in args):
            raise ValueError  # one or more args failed to compute with significance
    except ValueError:
        return

    with mpmath.workprec(prec):
        v = func(*args)

    return Expr._from_mpmath(v, prec)

sympy.sympy.core.numbers.__eq__:
def __eq__(self, other):
    try:
        other = _sympify(other)
    except SympifyError:
        return NotImplemented
    if self is other:
        return True
    if other.is_Number and self.is_irrational:
        return False

    return False    # NumberSymbol != non-(Number|self)
